function openTab(e,t){var a,n,l;for(n=document.getElementsByClassName("tabcontent"),a=0;a<n.length;a++)n[a].style.display="none";for(l=document.getElementsByClassName("tablinks"),a=0;a<l.length;a++)l[a].className=l[a].className.replace(" active","");document.getElementById(t).style.display="inline-block",e.currentTarget.className+=" active"}